import React, {Component} from 'react';
import {Grid, Cell} from 'react-mdl';

class LandingPage extends Component {
    render(){
        return(
            <div style ={{width:'100%' , margin: 'auto'}}>
                
                <Grid className="lading-grid">
                <Cell col={12}>
                <img src="https://www.google.com/url?sa=i&source=images&cd=&cad=rja&uact=8&ved=2ahUKEwj-usb4lZreAhWLxoUKHYvjANcQjRx6BAgBEAU&url=https%3A%2F%2Fopenclipart.org%2Fdetail%2F277084%2Fmale-avatar-3&psig=AOvVaw2ZY5tPmqZPgG5zkHcca07m&ust=1540301907470603"  alt ="avatar" className="avatar-img" /> 
                </Cell>
                </Grid>
            
            </div>
        )
    }
}

export default LandingPage;
